ImFont *AddFont_IconsFontAwesome5_Solid(float size_pixels)
{
    static const ImWchar icons_ranges[] = {ICON_MIN_FA, ICON_MAX_FA, 0};

    ImFontConfig icons_config;
    icons_config.MergeMode = true;
    icons_config.PixelSnapH = true;
    icons_config.GlyphOffset = ImVec2(0.0f, 1.0f);

    ImGuiIO &io = ImGui::GetIO();
    return io.Fonts->AddFontFromMemoryCompressedBase85TTF(fa_solid_900_compressed_data_base85, size_pixels, &icons_config, icons_ranges);
}

